import styled from 'styled-components';

export const AreaHeader = styled.div`

    
        a {
            text-decoration: none;
        }
        
        ul {
            list-style: none;
        }
        
        .nav-items {
            border: 2px solid red;
            margin-right: 25px;
        }
      
        
        @media only screen and (max-width: 610px) {

            .nav-bar {
                padding: 0;
                height: 150px;
                display: grid;
                
            }

            .logo-img-search-box {
                display: flex;
                gap: 15px;
    
            }

            .nav-items-btn-user-img {
                
                align-items: center;
            }

            .search-text {
                
                width: 300px;
               
            }
        }

        @media only screen and (max-width: 400px) {

            .nav-bar {
                
                width: 425px;
                padding: 0;
                height: 150px;
                display: grid;
                
            }

            .search-box {
                    
                width: 80%;
            }

            .nav-items-btn-user-img {
                width: 100%;
                align-items: center;
            }

            
            .search-text {
                
                width: 300px;
               
            }
        }

    
        
           



`;
